import React, { useState } from "react";
import { Button, Container, Nav, Navbar } from "react-bootstrap";
import { useHistory } from "react-router-dom";
import PostJob from "../Pages/company/PostJob";
const Header = () => {

  const [open , setOpen] = useState(false);

  const history = useHistory();


  const showModal = () => {
    setOpen(true)
  }

  const toggleModal =() => {
    setOpen(false);
  }

  const handleLogout = () => {
    history.push("/");
  };

  return (
    <div className="header">

    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="./vacancies">Campus Recruitment System</Navbar.Brand>
        <Nav className="navbar-lg">
          <Nav.Link href="./vacancy">Vacancies</Nav.Link>
          <Nav.Link href="./profile">Profile</Nav.Link>
          <Nav.Link href="./companies">Companies</Nav.Link>
          <Nav.Link href="./alljobs">All Jobs</Nav.Link>
          <Nav.Link href="./appliedjobs">Applied Jobs</Nav.Link>
          <Nav.Link href="./profilee">Profile</Nav.Link>

          <Button className="navbutton" variant="outline-success" onClick={showModal}>
            Post Job
          </Button>
          <Button className="buttonlogout" variant="outline-light" onClick={handleLogout}>
            Logout
          </Button>
        </Nav>
      </Container>
    </Navbar>

    <PostJob open = {open} toggleModal = {toggleModal}  />
    </div>
  );
};

export default Header;
